import './App.css';

import React,{Component} from 'react';
//import data from './user/users_job.js';
import data from './user/users.js';



class Table extends Component{
  constructor(props){ 
    super(props);

    this.myUserList = data;
  };


  render(){
    return (
      <table>
        <th style={{color:"black",fontSize:"15px"}}><h1>Nomes</h1></th>
          <td style={{color:"black",fontSize:"12px",width:"px"}}>{this.myUserList.map(user=>user.user_first_name)}</td>

        <th style={{color:"gray",fontSize:"15px",maxWidth:"20%"}}><h1>Data de Nascimento</h1></th>
          <td>{this.myUserList.map(user=>user.user_birth_date)}</td>

        <th style={{color:"gray",fontSize:"15px",maxWidth:"200px"}}><h1>Genero</h1></th>
          <td>{this.myUserList.map(user=>user.user_gender)}</td>

        <th style={{color:"gray",fontSize:"15px",maxWidth:"20%"}}><h1>Info</h1></th>
          <td>{this.myUserList.map(user=>user.user_gender)}</td>

        <th style={{color:"gray",fontSize:"15px",maxWidth:"20%"}}><h1>Endere√ßo</h1></th>
          <td>{this.myUserList.map(user=>user.user_address_id)}</td>

        <th style={{color:"gray",fontSize:"15px",maxWidth:"20%"}}><h1>Salario</h1></th>
          <td>{this.myUserList.map(user=>user.user_first_name)}</td>
      </table>
    )
  };

}


export default Table;
